pragma solidity ^0.8.10;

import "./interface/IFidoMeta.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Vesting is Ownable{

    struct VestingSchedule {
        uint totalAmount; // total Fidometa token to be vested.
        uint amountWithdrawn; // the amount that has been withdraw.
    }
    
    IFidoMeta public fidoMetaToken;

    mapping(address => VestingSchedule) public recipients; 

    constructor() Ownable() {
        
    }


}
